import styles from './singlePost.module.css'
import lifeImage from '../../image/LifeStory.jpeg'
const SinglePost = () => {
  return (
    <div className={styles.singlePost}>
      <div className={styles.singlePostWrapper}>
        <img src={lifeImage} alt='my life' className={styles.singlePostImage} />
        <h1 className={styles.singlePostTitle}>My Life Story</h1>
      </div>
    </div>
  )
}

export default SinglePost
